import Long1 from "../assets/long11.jpg";
import "../styles/LongCards/LongCards.scss";

const LongCards = () => {
  return (
    <>
      <div className="upper mx-7">
        <img src={Long1} alt="" className="w-full" />
        <div className="text-area text-white w-full text-center">
          Lorem, ipsum dolor sit amet consectetur adipisicing elit. Iusto, eos
          et doloremque voluptates id quia deleniti facilis expedita commodi
          aperiam dolores suscipit debitis necessitatibus ipsa distinctio fuga
          molestias omnis accusamus?
        </div>
        <div className="tag text-4xl font-bold">Architectural Design</div>
      </div>
      <div className="overlay border-2 text-blue-600 text-4xl">Border</div>
    </>
  );
};

export default LongCards;
